import React from 'react';
import { Grid } from '@mui/material';
import LoginPage from './LoginPage.png';
import ProductPage from './ProductPage.png';
import CheckoutPage from './CheckoutPage.png';
import '../styles/Style.css';

const Project = () => {
    return (
        <>
            <div className='container'>
                <h4 style={{ color: "blue", fontWeight: "800", margin: "4rem" }}>PROJECTS</h4>
                <div className='project'>
                    <Grid container spacing={2}>
                        <Grid item xs={12} sm={6} md={3}>
                            <img height={410} width={300} className='project-img' src={LoginPage} alt='Login Page' />
                        </Grid>
                        <Grid item xs={12} sm={6} md={8}>
                            <img height={300} width={600} className='project-img' src={ProductPage} alt='Product Page' />
                        </Grid>
                        <Grid item xs={12} sm={6} md={10}>
                            <img height={350} width={700} className='project-img' src={CheckoutPage} alt='Checkout Page' />
                        </Grid>
                    </Grid>
                </div>
            </div>
        </>
    );
}

export default Project;
